import propTypes from 'prop-types';
import Header from './Header';

export default function Page({ children, cool }) {
  return (
    <div>
      <Header />
      <h2>i am the page component</h2>
      {children}
      {cool}
    </div>
  );
}

Page.propTypes = {
  children: propTypes.any,
  cool: propTypes.string,
};
